import '../style/MainPage.css';
import BackstagePage from '../Backstage'
import ControlsPage from '../Controls'
import PreviewPage from '../Preview'
import VideoPage from '../Video'
import React from "react";


export default class MainPage extends React.Component {
    componentDidMount(){
      fetch("/api")
        .then((res) => res.json())
        .then((data) => this.setState({apiKey:data.apiKey, sessionId:data.sessionId, token:data.token}))
        .catch((err) => {
          console.error('Failed to get session creddentials', err);
          alert('Failed to get opentok sessionId and token');
        });

    }
    render(){
    return(
      <div className="MainPage"> 
        <div className="Column1">
          <VideoPage />
          <BackstagePage />
        </div>

        <div className = "Column2">
          <ControlsPage />
          <PreviewPage /> 
        </div>
      </div>
    );
    }
};
